import axios from './myAxios'

export function sendReqToGetTopBanners() {
  return axios({
    url: '/banner'
  })
}

export function sendReqToGetHotRec(limit) {
  return axios({
    url: '/personalized',
    params: {
      limit
    }
  })
}
